import React, { useState } from "react";
import "./App.css";
import Sidebar from "./components/Sidebar";
import ImageGrid from "./components/ImageGrid";
import TreeVisualizer from "./components/TreeVisualizer";

function App() {
  const [currentPrompt, setCurrentPrompt] = useState("");
  const [selectedImages, setSelectedImages] = useState([]);

  const handlePromptChange = (prompt) => setCurrentPrompt(prompt);
  const handleImageSelection = (images) => setSelectedImages(images);

  return (
    <div className="app-container">
      <Sidebar onPromptSelect={handlePromptChange} />
      <ImageGrid selectedImages={selectedImages} onSelect={handleImageSelection} />
      <TreeVisualizer />
    </div>
  );
}

export default App;
